import logo from './logo.svg';
import './App.css';
import React, {useContext, useEffect} from 'react';
import {login, session, SessionContext} from "./Contexts/SessionContext";

function App() {

    useEffect(() => {
       setTimeout(() => {
           login();
       }, 3000);
    });
  return (
    <div className="App">
      <SessionContext.Provider value={session}>
          <Test/>
      </SessionContext.Provider>
    </div>
  );
}

function isOnline() {
    return true;
}

const Test = () => {
    const session = useContext(SessionContext);

    console.log(session)
    return (
        <div></div>
    )
}

export default App;
